import React from 'react';
import { FaBars, FaTimes } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <>
      <header>
        <h3>Halfwayhome</h3>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/">Home design</Link>
          <Link to="/">Blog</Link>
          <Link to="/">Sign In</Link>
          <button>
            <FaTimes />
          </button>
        </nav>
        <button>
          <FaBars />
        </button>
      </header>
    </>
  );
};

export default Header;
